#include <gtest/gtest.h>

#include <algorithm>
#include <vector>

namespace {
	long long taskOfPairing(std::vector<long> freq) {
		long long pairs = 0;
		long carry = 0;

		for (auto count : freq) {
			long total = count + carry;
			pairs += total / 2;
			carry = total % 2;
		}
		return pairs;
	}
}

